import React from 'react'
import "./Home.css"
import cartimage from "../Assets/CartImage.jpg"
const Home = () => {
  return (
    <div className='homepage'>
      <img src={cartimage} alt="ecommerce-website"/>
    </div>
  )
}

export default Home
